// Import thư viện React
import React from 'react';
// Import các component có sẵn từ thư viện MDBReact
import {
    MDBRow,
    MDBCol,
    MDBCard,
    MDBCardImage,
    MDBCardBody,
    MDBCardTitle,
    MDBCardText,
    MDBCardFooter,
    MDBTooltip,
    MDBCarousel,
    MDBCarouselInner,
    MDBCarouselItem,
    MDBContainer,
} from 'mdbreact';
import ItemWishList from './ItemWishList';

// Danh sách yêu thích
const WishList = () => {
    return (
        <MDBContainer className="card-body">
            <section className='text-center my-5'>
                {/* Tên tiêu đề */}
                <h2 className=' font-weight-bold text-center my-5'>Danh sách yêu thích</h2>
                {/* Chú thích thêm */}
                <p className='grey-text text-center w-responsive mx-auto mb-5'>
                    QuickFood đã lưu lại toàn bộ những sản phẩm mà bạn yêu thích, hãy nhanh tay đặt mua và vote cho những sán phẩm yêu thích của bạn nhé!
                </p>
                {/* Danh sách sản phẩm */}
                <MDBCarousel activeItem={1} length={3} slide={true} showControls={true} showIndicators={true} multiItem>
                    <MDBCarouselInner>
                        <MDBRow>
                            <MDBCarouselItem itemId='1'>
                                <ItemWishList />
                                <ItemWishList />
                                <ItemWishList />
                            </MDBCarouselItem>
                            <MDBCarouselItem itemId='2'>
                                <ItemWishList />
                                <ItemWishList />
                                <ItemWishList />
                            </MDBCarouselItem>
                            <MDBCarouselItem itemId='3'>
                                <ItemWishList />
                                <ItemWishList />
                                <ItemWishList />
                            </MDBCarouselItem>
                        </MDBRow>
                    </MDBCarouselInner>
                </MDBCarousel>
            </section>
        </MDBContainer>
    );
};

export default WishList;
